import img1 from '../img/img1.JPG';
import img2 from '../img/img2.jpg';
import img3 from '../img/img3.jpg';
import img4 from '../img/img4.jpg';

export const Followers = [
    { name: "Endika", username: "endika", img: img1 },
    { name: "Aitor", username: "malamute", img: img2 },
    { name: "Ariane", username: "ariane", img: img3 },
    { name: "Jose", username: "jose", img: img4 },
]
